import './Navbar.scss'
import Topbar from './TopBar/Topbar';
import Menubar from './Menubar/Menubar';

export default function Navbar() {
  const [menuOpened, setMenuOpened] = useState(false)
  return (
    <div className='navbar-container'>
      <Topbar />
      <Menubar />
    </div>
  );
}
